import * as React from "react";
import { Typography, Link, makeStyles } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  footer: {
    flexGrow: 1,
    backgroundColor: "black",
    color: "#AFAFAF",
    padding: "20px",
  },
  footerText: {
    fontSize: "12px",
    textAlign: "center",
    width: "80%",
    margin: "0 auto",
    float: "bottom"
  },
}));

function Copyright(props) {
  const classes = useStyles();
  return (
    <Typography className={classes.footerText} {...props}>
      {"Copyright © "}
      {new Date().getFullYear()}
      {"."} 
      <Link href="https://ipo.rutgers.edu/">
        Rutgers, The State University of New Jersey. All rights reserved.
      </Link>{" "}
      <div>Rutgers is an equal access/equal opportunity institution. Individuals with disabilities are encouraged to direct suggestions, comments, or complaints concerning any accessibility issues with Rutgers websites to accessibility@rutgers.edu or complete the 
      <Link href="https://rutgers.ca1.qualtrics.com/jfe/form/SV_57iH6Rfeocz51z0">
      Report Accessibility Barrier / Provide Feedback form.
      </Link>{" "}

     </div>
    </Typography>
  );
}

export default function Footer() {
  const classes = useStyles();
  return (
    <div className={classes.footer}>
      <Copyright sx={{ mt: 8, mb: 4 }} />
    </div>
  );
}
